import React from 'react';
import UUID from 'uuidjs'

export default function THead({cols, ...props}){
    return (
        <thead {...props}>
            <tr>
                { cols && Object.keys(cols).map( col => (
                    <th key={UUID.genV1()} className={"th-"+col}/>
                ))}
            </tr>
        </thead>
    )
}
